// Navigation.jsx

import React from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/o-nama">O nama</Link>
        </li>
        <li>
          <Link to="/ishrana">Ishrana</Link>
        </li>
        <li>
          <Link to="/trening">Trening</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
